import React, { useState } from 'react';
import FacebookLogin from 'react-facebook-login';
import axios from 'axios';

function App() {
  const [user, setUser] = useState(null);
  const [pages, setPages] = useState([]);
  const [selectedPage, setSelectedPage] = useState('');
  const [insights, setInsights] = useState(null);
  const [dateRange, setDateRange] = useState({ since: '', until: '' });

  const responseFacebook = async (response) => {
    setUser(response);
    if (response.accessToken) {
      const pagesResponse = await axios.get(`https://graph.facebook.com/v13.0/me/accounts?access_token=${response.accessToken}`);
      setPages(pagesResponse.data.data);
    }
  };

  const handlePageSelect = (e) => {
    setSelectedPage(e.target.value);
  };

  const handleDateChange = (e) => {
    setDateRange({ ...dateRange, [e.target.name]: e.target.value });
  };

  const fetchInsights = async () => {
    if (!selectedPage || !dateRange.since || !dateRange.until) return;

    const page = pages.find(p => p.id === selectedPage);
    const insightsResponse = await axios.get(`https://graph.facebook.com/v13.0/${selectedPage}/insights`, {
      params: {
        metric: 'page_fans,page_engaged_users,page_impressions,page_reactions_total',
        access_token: page.access_token,
        period: 'day',
        since: dateRange.since,
        until: dateRange.until,
      }
    });

    const processedInsights = insightsResponse.data.data.reduce((acc, insight) => {
      acc[insight.name] = insight.values.reduce((sum, value) => sum + value.value, 0);
      return acc;
    }, {});

    setInsights(processedInsights);
  };

  return (
    <div className="App">
      {!user ? (
        <FacebookLogin
          appId="1677858482954106"
          autoLoad={false}
          fields="name,email,picture"
          callback={responseFacebook}
        />
      ) : (
        <div>
          <h2>Welcome, {user.name}!</h2>
          <img src={user.picture.data.url} alt="Profile" />

          <h3>Select a Page:</h3>
          <select onChange={handlePageSelect}>
            <option value="">Select a page</option>
            {pages.map(page => (
              <option key={page.id} value={page.id}>{page.name}</option>
            ))}
          </select>

          <h3>Select Date Range:</h3>
          <input type="date" name="since" onChange={handleDateChange} />
          <input type="date" name="until" onChange={handleDateChange} />

          <button onClick={fetchInsights}>Get Insights</button>

          {insights && (
            <div>
              <h3>Page Insights:</h3>
              <div>Total Followers: {insights.page_fans}</div>
              <div>Total Engagement: {insights.page_engaged_users}</div>
              <div>Total Impressions: {insights.page_impressions}</div>
              <div>Total Reactions: {insights.page_reactions_total}</div>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default App;
